import React from "react";

const About = () => {
  return (
    <section id="about" className="about">
      <h2>About Us</h2>
      <p>We help you build a better career.</p>
      <p>We provide career guidance, training, and job assistance in various fields.</p>
      <p>Our vision is to help people reach their career potential with personalized support and guidance.</p>

    </section>
  );
};

export default About;
